        public MainWindow()
        {
            InitializeComponent();

            string connectionString = "DefaultEndpointsProtocol=https;AccountName=xpsconversion;AccountKey=xwQ3gqYQ0meY0+sY2vJ1pOB5PJ8M1kJv+W7mlFUUXbmdxpl7UD0+3BPEVZ7WhRuK1Jh27xcKPXcr+AStsnVQcw==;EndpointSuffix=core.windows.net"; // replace with your Azure Blob Storage connection string

            string containerName = "syncfusionxps"; // replace with the name of your container

            string blobName = "XPStoPDF.pdf"; // replace with the name you want to give your PDF file

            BlobServiceClient blobServiceClient = new BlobServiceClient(connectionString);

            BlobContainerClient containerClient = blobServiceClient.GetBlobContainerClient(containerName);

            MemoryStream memoryStream = new MemoryStream();

            // Create a new blob with the specified name and upload the PDF file to it

            BlobClient blobClient = containerClient.GetBlobClient(blobName);

            string base64 = @"";

            XPSToPdfConverter xPSToPdfConverter = new XPSToPdfConverter();
            PdfDocument document = xPSToPdfConverter.Convert(Convert.FromBase64String(base64));
            // Get the current UTC date and time
            DateTime utcNow = DateTime.UtcNow;

            // Convert UTC to IST
            TimeZoneInfo istTimeZone = TimeZoneInfo.FindSystemTimeZoneById("India Standard Time");
            DateTime istNow = TimeZoneInfo.ConvertTimeFromUtc(utcNow, istTimeZone);

            // Format the date and time in 12-hour format
            string formattedDateTime = istNow.ToString("yyyy-MM-dd hh:mm:ss tt");
            document.Pages[0].Graphics.DrawString(formattedDateTime, new PdfStandardFont(PdfFontFamily.Helvetica, 11), PdfBrushes.Black, new Syncfusion.Drawing.PointF(10, 150));
           
            document.Save(memoryStream);
            document.Close(true);
            memoryStream.Position = 0;

            blobClient.Upload(memoryStream);
           
            this.Close();
        }
    }
